		console.error(err);
		next(err);
	}
}
function* watchFetchNote() {
	yield takeLatest(FETCH_NOTE_REQUEST, fetchNote);
}
function* watchFetchNoteList() {
	yield takeLatest(FETCH_NOTE_LIST_REQUEST, fetchNoteList);
